- input: "TEXT\x1CC00250209\x1C2\x1CB210135\x1CSB23\x1C\"This amendment is filed in
    response to the Commission's Request for Additional Information (RFAI) dated May
    30, 2008.  The RFAI noted a that two contributions originally disclosed on this
    report to Dutch Ruppersberger for Congress were designated to the Primary election
    after the Maryland Primary election date of 2/12/08.  In reviewing our records
    and those filed by the candidate's committee, we discovered that one of the contributions
    originally disclosed with a date of 3/7/08 should have been disclosed with a date
    of 2/10/08.  It has been removed from this report and is disclosed on the Amended
    FEC March Monthly Report also filed today.  The other contribution dated 3/7/08
    was incorrectly designated to the Primary due to a clerical error.  You will find
    the entry for this contribution with the correct election designation on page
    31 of this report.  Please update your records accordingly with the correct designation
    so that future queries run by visitors to the FEC website will return the correct
    data.\""
